export interface CharacterData {
    name: string;
    gender: string;
}

export interface PopupProps {
    clickData: string;
    characterItem: CharacterData | null;
    showPopup: boolean;
    setShowPopup: boolean;
    isCorrect: boolean;
    setIsCorrect: boolean;
    counter: number;
    questionLimit: number;
    nextQuestion: () => void;
}

export interface ClickCounterProps {
    counter: number;
    questionLimit: number;
}

export interface ClickData {
    clickData: (SGItem: string) => void;
}

export interface Gender {
    selectGender: string;
}
